import React from 'react';
import './App.css';
import Person from './Person/Person';

function App() {
  return (
    <div className="App">
      <h1>Hi i'm foush</h1>
      <Person name="foush" age="24"></Person>
      <Person name="ibrahiam" age="13"></Person>
      <Person name="Ali" age="25"></Person>

    </div>
  );
}

export default App;
